/* eslint-disable prettier/prettier */
import styled from 'styled-components';

const IndexGrid = styled.div`
  .grid{
    display: grid;
    grid-gap: 0;
    grid-template-columns: 25vw 35vw 35vw 25vw;
    grid-template-rows: 50vh 50vh 50vh 50vh;
  }

  #hoodies {
    grid-row: 1 / 2;
    grid-column: 1;
    padding: 0;
    margin: 0;
    max-height: 500px;
    max-width: 25%;
  }

  #dresses {
    grid-row: 3 / 4;
    grid-column: 1;
    padding: 0;
    margin: 0;
    max-height: 500px;
    max-width: 25%;
  }

  #footwear {
    grid-row: 1;
    grid-column: 2;
    padding: 0;
    margin: 0;
    max-height: 500px;
    max-width: 25%;
  }

  #shirts {
    grid-row: 1;
    grid-column: 3;
    padding: 0;
    margin: 0;
    max-height: 500px;
    max-width: 25%;
  }

  #kids {
    grid-row: 1 / 2;
    grid-column: 4;
    padding: 0;
    margin: 0;
    max-height: 500px;
    max-width: 25%;
  }

  #accessories {
    grid-row: 3 / 4;
    grid-column: 4;
    padding: 0;
    margin: 0;
    max-height: 500px;
    max-width: 25%;
  }

  #male {
    grid-row: 2 / 4;
    grid-column: 3;
    padding: 0;
    margin: 0;
    max-height: 500px;
    max-width: 25%;
  }

  #female {
    grid-row: 3 / 5;
    grid-column: 2;
    padding: 0;
    margin: 0;
    max-height: 500px;
    max-width: 25%;
  }
`;

export default IndexGrid;
